On Tuesday, November 8, between 3:02 and 6:42 a.m. EST (0802-1350 UTC), a total lunar eclipse will occur, the last total lunar eclipse until March 14, 2025.

A lunar eclipse occurs when the Sun, Earth, and Moon align, allowing the Moon to pass into Earth\'s shadow. In a total lunar eclipse, the entire Moon falls within the umbra  the darkest part of Earth\'s shadow.

During a lunar eclipse, light passes through our atmosphere before reaching the lunar surface, allowing colors of longer wavelengths, such as red and orange, to lightly illuminate its surface, while colors like blue and violet scatter across our planet.

Image description:

A composite photo shows the Moon in different stages of the eclipse from top left to bottom right. The Moon appears nearly full at the top left in the image before gradually becoming more obscured by Earth\'s shadow from the top left of the Moon. The skyline of Houston, Texas, can be seen in the distance.

Credit: NASA\/Norah Moran

#Eclipse #Moon #Space #Artemis\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2966537580937971399.jpg?w=200&till=1677740126&sign=b03bf33941849b812d7ed524687778c0\";s:11:\"time_posted\";i:1667858859;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2966537580937971399.jpg?w=200&till=1677740126&sign=b03bf33941849b812d7ed524687778c0\";s:3:\"day\";s:2:\"07\";s:5:\"month\";s:2:\"11\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4849586;s:14:\"comments_count\";i:7634;s:17:\"video_views_count\";i:0;s:2:\"er\";d:5.57;s:7:\"er_mark\";s:4:\"high\";}}i:1;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2910700419647899117\";s:4:\"code\";s:11:\"Chk4pwwsYXt\";s:7:\"caption\";s:2134:\"Giant news from a giant planet! 

@NASAWebb captured a new view of Jupiter in infrared light, uncovering clues to the planets inner life in a new image. In addition to the planets iconic Great Red Spot, two of its moons, rings, and even distant galaxies are visible.

Since infrared light is invisible to humans, the light has been mapped onto the visible spectrum. Generally, the longest wavelengths appear redder and the shortest wavelengths are shown as more blue.

Citizen scientist Judy Schmidt processed these images and turned the raw data collected from Webb\'s sensors into the visual you see here.

Image Description 1: Jupiter dominates the black background of space. The image is a composite, and shows Jupiter in enhanced color. The planets Great Red Spot appears white here. The planet is striated with swirling horizontal stripes of neon turquoise, periwinkle, light pink, and cream. The stripes interact and mix at their edges like cream in coffee. Along both of the poles, the planet glows in turquoise. Bright orange auroras glow just above the planets surface at both poles.

Image Description 2: A wide field view showcases Jupiter in the upper right quadrant. The planets swirling horizontal stripes are rendered in blues, browns, and cream. Electric blue auroras glow above Jupiters north and south poles. A white glow emanates out from the auroras. Along the planets equator, rings glow in a faint white. These rings are one million times fainter than the planet itself! At the far left edge of the rings, a moon appears as a tiny white dot. This moon is only about 12 miles (20 km) across. Slightly further to the left, another moon, about 100 miles (150 km) across, glows with tiny white diffraction spikes. The rest of the image is the blackness of space, with faintly glowing white galaxies in the distance.

Credit 1: NASA, ESA, CSA, Jupiter ERS Team; image processing by Judy Schmidt.

Credit 2: NASA, ESA, CSA, Jupiter ERS Team; image processing by Ricardo Hueso (UPV\/EHU) and Judy Schmidt.

#NASA #JWST #Webb #Astrophotography #Jupiter #Space #SolarSystem #CitizenScience #Planet\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2910700419647899117.jpg?w=200&till=1677740126&sign=d6196680f0b8722206f85fc52b6cf180\";s:11:\"time_posted\";i:1661202553;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2910700419647899117.jpg?w=200&till=1677740126&sign=d6196680f0b8722206f85fc52b6cf180\";s:3:\"day\";s:2:\"22\";s:5:\"month\";s:2:\"08\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:3530888;s:14:\"comments_count\";i:8748;s:17:\"video_views_count\";i:0;s:2:\"er\";d:4.06;s:7:\"er_mark\";s:4:\"high\";}}i:2;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2932171668421424338\";s:4:\"code\";s:11:\"CixKpjcuTTS\";s:7:\"caption\";s:2094:\"Hey Neptune. Did you ring? \r\r@NASAWebb captured the clearest look at Neptune\'s rings in 30+ years  our first time seeing them in infrared light.\r\rSwipe to the second and third images to check out 7 of Neptunes moons. See that object in the upper left? Thats no star. Its Neptunes large, unusual moon, Triton! Because Triton is covered in frozen, condensed nitrogen, it reflects 70% of the sunlight that hits it  making it appear very bright to Webb. The other 6 moons can be seen as tiny dots surrounding Neptune and its rings.\r\rNeptune and Triton can still be seen at the center of the last image, which zooms out to show the big picture. Webbs powerful infrared vision uncovers scores of background galaxies and stars. Read more about these views of Neptune at @NASAWebbs link in bio!\r\rImage Descriptions:\r\r1) Neptunes rings are distinctly visible in this image taken by Webb. Set against a dark background, the planet resembles a pearl with ethereal concentric ovals around it.\r\r2) A large, prominent 8-pointed object, colored in teal, is Neptunes moon Triton on the upper left. A small, pearl-like Neptune is below and to the right of Triton. Its rings are a standout feature. Surrounding Neptune and its rings are 6 other moons, seen as tiny dots. Clockwise, starting from 3 oclock, they are: Despina, Proteus, Larissa, Thalassa, Naiad, Galatea. The background is dark and sprinkled with a few other distant objects.\r\r3) Labeled version of the previous image. There are arrows and labels in small white text pointing out each of the 7 Neptune moons that can be seen.\r\r4) Zoomed out view of Neptune, its rings and its moons as captured by Webb. Neptunes moon Triton, resembling a small teal snowflake, is the central focal point, with a tiny ringed, pearl-like Neptune below and to the right of it. The black background is filled with galaxies, 8-pointed bright objects and dots. A small white spiral galaxy in the bottom left corner is particularly visible.\r\rCredit: NASA, ESA, CSA, STScI\r\r#NASA #Neptune #NASAWebb #Space #Planets #SolarSystem #Webb\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2932171668421424338.jpg?w=200&till=1677740126&sign=fc59b1e928f6eeb56b93ee0973838e6d\";s:11:\"time_posted\";i:1663762123;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2932171668421424338.jpg?w=200&till=1677740126&sign=fc59b1e928f6eeb56b93ee0973838e6d\";s:3:\"day\";s:2:\"21\";s:5:\"month\";s:2:\"09\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:3491999;s:14:\"comments_count\";i:17833;s:17:\"video_views_count\";i:0;s:2:\"er\";d:4.02;s:7:\"er_mark\";s:4:\"high\";}}i:3;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2952525956960193944\";s:4:\"code\";s:11:\"Cj5erb2u42Y\";s:7:\"caption\";s:1799:\"These pillars stand the test of time.

Journey with us through the James Webb Space Telescopes breathtaking view of the Pillars of Creation, where scores of newly formed stars glisten like dewdrops among floating, translucent columns of gas and dust. These pillars are just a tiny portion of the vast Eagle Nebula, which lies 6,500 light-years away.

If this majestic landscape looks familiar, you may recognize the original. @NASAHubble first captured the Pillars of Creation in 1995 and revisited it in 2014. Webbs latest view was taken in near-infrared light, which is invisible to our eyes. Seeing in infrared allows Webb to pierce through the dust and reveal stars galore.

Why go back to where weve been before? Webb helps us identify far more precise counts of newborn stars, along with the quantities of gas and dust. This will deepen our understanding of how stars form and burst out of these dusty clouds over millions of years. Read more at the link in @NASAWebbs bio!

Image description: Vertical image with layers of semi-opaque, rusty red gas and dust that start at the bottom left and go toward the top right. There are three prominent pillars rising toward the top right. The left pillar is the largest and widest. The peaks of the second and third pillars are set off in darker shades of brown and have red outlines. Peeking through the layers of gas and dust is the background, set in shades of blue and littered with tiny yellow and blue stars. Many of the tips of the pillars appear tinged with what looks like lava. There are also tiny red dots at the edges of the pillars, which are newly born stars.

Credit: NASA, ESA, CSA, STScI

#PillarsOfCreation #Nebula #Astronomy #Science #Space #JWST #JamesWebbSpaceTelescope #Webb #NASA\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2952525956960193944.jpg?w=200&till=1677740126&sign=3cde555ecce065b31ffd1873e481549f\";s:11:\"time_posted\";i:1666188543;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2952525956960193944.jpg?w=200&till=1677740126&sign=3cde555ecce065b31ffd1873e481549f\";s:3:\"day\";s:2:\"19\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:3445289;s:14:\"comments_count\";i:12778;s:17:\"video_views_count\";i:0;s:2:\"er\";d:3.96;s:7:\"er_mark\";s:4:\"high\";}}i:4;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2941880763075232296\";s:4:\"code\";s:11:\"CjTqPeep4Io\";s:7:\"caption\";s:2248:\"So nice, we captured it twice 

@NASAWebbs first infrared images are brought to new light with the addition of X-ray data from @NASAChandraXray.

Cartwheel Galaxy: The Cartwheel Galaxy got its shape from a collision with a smaller galaxy (outside the field) about 100 million years ago. X-rays seen by Chandra (blue and purple) come from superheated gas, exploded stars, and neutron stars and black holes pulling material from companion stars. Webbs infrared view (red, orange, yellow, green, blue) shows the Cartwheel Galaxy plus 2 smaller companions (not part of the collision) against a backdrop of many more distant galaxies.

Stephan\'s Quintet: 4 galaxies in Stephans Quintet are undergoing an intricate gravitational dance. (The 5th galaxy on the left is at a different distance!) Webbs image (red, orange, yellow, green, blue) features never-seen-before details, like sweeping tails of gas and star formation bursts. Chandra (light blue) uncovers a shock wave that heats gas to tens of millions of degrees, as one galaxy passes through the others at around 2 million miles per hour. This image also includes infrared data from Spitzer (red, green, blue), now retired.

Deep Field: Webb shows how a galaxy cluster, located ~4.2 billion light-years away, contains hundreds of galaxies. Galaxy clusters are filled with vast reservoirs of superheated gas seen only in X-ray light. Chandra data (blue) reveals gas with temperatures of tens of millions of degrees, possessing a total mass about 100 trillion times that of the Sun. Invisible dark matter forms an even larger fraction of the clusters total mass.

Carina Nebula: Chandras data (pink) reveals over a dozen X-ray sources. These are mostly 1-2 million year old stars (very young for stars!) located in the outer region of a star cluster in the Carina Nebula. Young stars are much brighter in X-rays than old stars. The X-ray emission in the images top half likely comes from hot gas from the nebulas 3 hottest, most massive stars, outside Webbs view. Webbs image uses: red, orange, yellow, green, cyan, and blue.

Credit: X-ray-NASA\/CXC\/SAO; IR (Webb): NASA\/ESA\/CSA\/STScI; IR (Spitzer): NASA\/JPL-Caltech

#NASA\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2941880763075232296.jpg?w=200&till=1677740126&sign=58780e9cb14491ecd6b5790093769673\";s:11:\"time_posted\";i:1664919537;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2941880763075232296.jpg?w=200&till=1677740126&sign=58780e9cb14491ecd6b5790093769673\";s:3:\"day\";s:2:\"04\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:2961639;s:14:\"comments_count\";i:8862;s:17:\"video_views_count\";i:0;s:2:\"er\";d:3.4;s:7:\"er_mark\";s:4:\"high\";}}i:5;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"3015589148724107715\";s:4:\"code\";s:11:\"CnZhlp-ORnD\";s:7:\"caption\";s:1673:\"The cold never bothered me anyway 

Our Cassini spacecraft glimpsed Saturn\'s cold and icy moon Enceladus, whose frozen surface ice hides a deep ocean. Though it may look like rivers etch the surface of the small moon, the cracks covering the surface are believed to be from relatively warm sections in the crust, where ice water particles and gasses jet out continuously from the oceans below, contributing to Saturn\'s E ring. Some of these fissures may be hydrothermal vents that stretch down to its ocean.

Enceladus is a small moon that orbits Saturn at a distance of 148,000 miles (238,000 km) in a tidally locked elliptical pattern  the same side of Enceladus faces toward the planet, with an average temperature of -330 F (-201 C). The average thickness of the icy shell is about 12 to 16 miles (20 to 25 km).

In 2005, the Cassini spacecraft first examined the moon\'s south polar region, capturing its unique and complex terrain. Along the way, the spacecraft has deepened our understanding of the moon  leading scientists to believe that Enceladus\' chemistry, vast oceans, and internal heat  make it a prime world to search for life beyond our planet.

Image description: Cassini\'s image of the white surface of Enceladus is seen in an enhanced colored view. The moon\'s surface is marred by light blue cracks spreading out in all directions and spotted with deep craters. The planet is not fully visible as black space surrounds the moon, and a shadow envelops the right side of its surface.

Credit: NASA\/JPL-Caltech\/Space Science Institute

