\":12:{s:2:\"id\";s:19:\"2915255986803156016\";s:4:\"code\";s:11:\"Ch1Ed_Su6Qw\";s:7:\"caption\";s:120:\"Midnights, the stories of 13 sleepless nights scattered throughout my life, will be out October 21. Meet me at midnight.\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2915255986803156016.jpg?w=200&till=1677740135&sign=d05fa791f2a31de5f85c423c2fb4271b\";s:11:\"time_posted\";i:1661745616;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2915255986803156016.jpg?w=200&till=1677740135&sign=d05fa791f2a31de5f85c423c2fb4271b\";s:3:\"day\";s:2:\"29\";s:5:\"month\";s:2:\"08\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:8065162;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:3.41;s:7:\"er_mark\";s:4:\"high\";}}i:1;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2961894145347154677\";s:4:\"code\";s:11:\"CkawwhLufL1\";s:7:\"caption\";s:571:\"Im enchanted to announce my next tour: Taylor Swift | The Eras Tour, a journey through the musical eras of my career (past and present!) The first leg of the tour will be in stadiums across the US, with international dates to be announced as soon as we can! Feeling like the luckiest person alive because I get to take these brilliant artists out on tour with me: @paramore, @radvxz, @phoebebridgers, @girlinred, @whereismuna, @haimtheband, @gracieabrams, @gayle and @owennmusic. I cant WAIT to see your gorgeous faces out there. Its been a long time coming \";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2961894145347154677.jpg?w=200&till=1677740135&sign=edcc0120325d183b0e789b299275f648\";s:11:\"time_posted\";i:1667305318;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2961894145347154677.jpg?w=200&till=1677740135&sign=edcc0120325d183b0e789b299275f648\";s:3:\"day\";s:2:\"01\";s:5:\"month\";s:2:\"11\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:5627435;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:2.38;s:7:\"er_mark\";s:4:\"good\";}}i:2;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2953760335023622199\";s:4:\"code\";s:11:\"Cj93WAAuMg3\";s:7:\"caption\";s:441:\"Surprise! I think of Midnights as a complete concept album, with those 13 songs forming a full picture of the intensities of that mystifying, mad hour. However! There were other songs we wrote on our journey to find that magic 13. Im calling them 3am tracks. Lately Ive been loving the feeling of sharing more of our creative process with you, like we do with From The Vault tracks. So its 3am and Im giving them to you now. \";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953760335023622199.jpg?w=200&till=1677740135&sign=0c06da61eae86774cdef16068422101d\";s:11:\"time_posted\";i:1666335692;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953760335023622199.jpg?w=200&till=1677740135&sign=0c06da61eae86774cdef16068422101d\";s:3:\"day\";s:2:\"21\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4862234;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:2.06;s:7:\"er_mark\";s:4:\"good\";}}i:3;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2953669479344288504\";s:4:\"code\";s:11:\"Cj9ir4EOrL4\";s:7:\"caption\";s:1144:\"Midnights is a wild ride of an album and I couldnt be happier that my co pilot on this adventure was @jackantonoff. Hes my friend for life (presumptuous I know but I stand by it) and weve been making music together for nearly a decade HOWEVER this is our first album weve done with just the two of us as main collaborators. Wed been toying with ideas and had written a few things we loved, but Midnights actually really coalesced and flowed out of us when our partners (both actors) did a film together in Panama. Jack and I found ourselves back in New York, alone, recording every night, staying up late and exploring old memories and midnights past. We were so lucky to also work with our brilliant collaborators @sam_dew, @sounwave, Lana Del Rey, @jahaansweet, @keanubeats, William Bowery, and @zoeisabellakravitz. @sharp_stick was our excellent engineer. The wonderful and wise @bethgarrabrant took the album photographs. Midnights is a collage of intensity, highs and lows and ebbs and flows. Life can be dark, starry, cloudy, terrifying, electrifying, hot, cold, romantic or lonely. Just like Midnights. Which is out now\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953669479344288504.jpg?w=200&till=1677740135&sign=d0d361068f8560253ca1c69092ca60b4\";s:11:\"time_posted\";i:1666324861;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:11:\"social_type\";s:2:\"ig\";s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953669479344288504.jpg?w=200&till=1677740135&sign=d0d361068f8560253ca1c69092ca60b4\";s:3:\"day\";s:2:\"21\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4470824;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:1.89;s:7:\"er_mark\";s:4:\"good\";}}i:4;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":12:{s:2:\"id\";s:19:\"2956333196569703401\";s:4:\"code\";s:11:\"CkHAWEDO3Pp\";s:7:\"caption\";s:400:\"Midnight, what a storied and fabled hour On this sparkling evening Ill be releasing my twist on a fairytale we all know. The one about the girl and her step sisters and the clock striking 12 This video is wild, whimsical and crea